let span = 4;

export default {
    props: {
        value: {
            type: Boolean,
            default: false
        }
    },
    data() {
        return {
            form: this.$form.createForm(this),
            formLayout: {
                labelCol: {span: span},
                wrapperCol: {span: 24 - span}
            },
            formTailLayout: {
                labelCol: {span: span},
                wrapperCol: {span: 24 - span, offset: span}
            },
        }
    },
    methods: {
        bindClickClose() {
            this.form.resetFields();
            this.$emit('input', false);
        },
    }
}
